public Object getValue(){

Object m = dataRow.get("DOC_DATE_MONTH");

if(m == null) return (String) "";

String ms = (m instanceof String)?((String)m):m.toString();

if(ms.equals("1")){return "января";}
if(ms.equals("2")){return "февраля";}
if(ms.equals("3")){return "марта";}
if(ms.equals("4")){return "апреля";}
if(ms.equals("5")){return "мая";}
if(ms.equals("6")){return "июня";}
if(ms.equals("7")){return "июля";}
if(ms.equals("8")){return "августа";}
if(ms.equals("9")){return "сентября";}
if(ms.equals("10")){return "октября";}
if(ms.equals("11")){return "ноября";}
if(ms.equals("12")){return "декабря";}

return (String) "";
}
